%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%% Introductie                                            %%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

state(intro, s1, say).
text(intro,  s1, "Hallo, ik ben Hero.").
image(intro, s1, "data:image/jpeg;base64,").
next(intro,  s1, _, s1q).

state(intro, s1q, question).
stateConfig(intro, s1q, [type=openend, context='answer_open', inputModality=[speech=1]]).
text(intro,  s1q, "Hoe heet jij?").
next(intro,  s1q, _, s1r).

state(intro, s1r, say).
text(intro,  s1r, "Hoi %first_name%, leuk je te ontmoeten!").
next(intro,  s1r, _, s1i1).

state(intro, s1i1, say).
text(intro,  s1i1, "Ik weet veel over slaap.").
next(intro,  s1i1, _, s1i2).

state(intro, s1i2, say).
text(intro,  s1i2, "Mijn vriendjes noemen mij daarom ook wel een slaap professor.").
next(intro,  s1i2, _, s1i3).

state(intro, s1i3, say).
text(intro,  s1i3, "Ik vind het leuk om daar met jou over te praten!").
next(intro,  s1i3, _, s3i4).

state(intro, s3i4, say).
text(intro,  s3i4, "Ik ga je steeds eerst een vraag stellen, en dan kun jij daar antwoord op geven.").
next(intro,  s3i4, _, s3i5).

state(intro, s3i5, say).
text(intro,  s3i5, "Dat kan door met mij te praten, maar soms gaan we ook de tè blèet gebruiken.").
next(intro,  s3i5, _, s3i6).

state(intro, s3i6, say).
text(intro,  s3i6, "Misschien heb ik daarna een tip voor je.").
next(intro,  s3i6, _, s3i7).

state(intro, s3i7, say).
text(intro,  s3i7, "Dan zal ik mijn lichtjes oranje maken, zodat je mijn tips goed kunt herkennen.").
leds(intro,  s3i7, direct, ['FaceLeds', 'ChestLeds'], ['orange', 'orange']).
next(intro,  s3i7, _, s4i).

state(intro, s4i, say).
text(intro,  s4i, "Laten we beginnen.").
leds(intro,  s4i, direct, ["RightFootLeds"], ["wit"]).

%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%
%%% Algemeen                                               %%%
%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%%

state(algemeen, s1, question).
stateConfig(algemeen, s1, [type=quiz, context='answer_character', inputModality=[tablet=1], options=[
'<img style="width:18rem" data-value="c1" src="data:image/jpeg;base64,">',
'<img style="width:18rem" data-value="c2" src="data:image/jpeg;base64,">',
'<img style="width:18rem" data-value="c3" src="data:image/jpeg;base64,">',
'<img style="width:18rem" data-value="c4" src="data:image/jpeg;base64,">'
], correctAnswer=[_], question="Kun jij er eentje kiezen die je leuk vindt of die het meest op jou lijkt?"]).
text(algemeen,  s1, "Kijk maar eens mee op de tè blèet; daar zie je vier verschillende karakters. Kun jij er eentje kiezen die je leuk vindt, of die het meest op jou lijkt?").
next(algemeen,  s1, _, s1c1).

state(algemeen, s1c1, say).
text(algemeen,  s1c1, "Goed gedaan! Vanaf nu zal je dit karakter steeds terug zien.").
