state(algemeen, s1i1, say).
text(algemeen,  s1i1, "Vind je zelf dat je goed slaapt?").
next(algemeen,  s1i1, _, s1q).

state(algemeen, s1q, question).
stateConfig(algemeen, s1q, [type=quiz, context='answer_sleep', inputModality=[tablet=1], options=[1,2,3], correctAnswer=['o1'], question="Welk antwoord past het beste bij jou?"]).
text(algemeen,  s1q, "Je kunt op de tè blèet kiezen tussen drie antwoorden. De eerste is dat je meestal goed slaapt, de tweede is dat je soms goed, soms slecht slaapt, en de derde is dat je meestal slecht slaapt. Welk antwoord past het beste bij jou?").
next(algemeen,  s1q, 'correct', s1g1).
next(algemeen,  s1q, _, s1s1). % TODO: failure case?

state(algemeen, s1g1, say).
text(algemeen,  s1g1, "Wat fijn om te horen! Ik ben blij dat je vindt dat je goed slaapt.").
display(algemeen, s1g1, "").

state(algemeen, s1s1, say).
text(algemeen,  s1s1, "Wat knap dat je dat durft aan te geven! Slapen is ook lastig.").
display(algemeen, s1s1, "").
next(algemeen,  s1s1, _, s1s2).

state(algemeen, s1s2, say).
text(algemeen,  s1s2, "Hopelijk kan ik je helpen met wat tips.").

